import React, { Component } from "react";
import './Project.css';

class Project extends Component {
	render() {
    	const { params } = this.props.match;
    return (
      <div className="Project">
          <div className="img-header"/>

          <div className="para">
            <h1>
            { params.id }
            </h1>
            <p>{props.body}</p>
          </div>
            <div className="img-header"/>
      </div>
    );
  }
	}

export default Project;
